const PaanCorner = () => {
  const containerStyle = {
    textAlign: 'center',
    padding: '40px 20px',
    fontFamily: 'Segoe UI, Tahoma, Geneva, Verdana, sans-serif',
  };

  const imageStyle = {
    width: '200px',
    maxWidth: '80%',
    marginBottom: '20px',
  };

  const headingStyle = {
    fontSize: '24px',
    color: '#333',
  };

  const paragraphStyle = {
    fontSize: '20px',
    color: '#555',
  };

  return (
    <div style={containerStyle}>
      <img
        src="https://cdn-icons-png.flaticon.com/512/7335/7335470.png"
        alt="Coming Soon"
        style={imageStyle}
      />
      <h1 style={headingStyle}>We're exploring more paan products for you!</h1>
      <p style={paragraphStyle}>Coming Soon üçÉ</p>
    </div>
  );
};

export default PaanCorner;
